window.bookSummaryJSON = "<p><b>Once upon a time, humankind ruled the world while lycans and vampires lived in secret. This is no longer that time.</b></p> <p><b>Rae</b></p> <p>Blood Day - the culmination of my training. The day I find out my fate. I will not cry. I will not beg. I will remain calm. Emotions are for the weak, and I am not weak. My name is Rae and I will survive this. But I never expected him to call my name....</p> <p><b>Kylan</b></p> <p>Someone wants to frame me for immortal insanity? Be my guest, darling. I'll just pick a fighter as my bait, a consort with a hint of defiance. And when the culprit attempts to bite, I'll be the one who bites back. Because no one touches what's mine, including the fiery redhead at my side.</p> <p>Welcome to Kylan City. I dare you all to come out and play.</p> <p><b>Contains mature themes.</b></p>"; 
